class DisplayUtils:
    @staticmethod
    def progress_bar(success, failure, width=30):
        total = success + failure
        if total == 0:
            return f"{Colors.CYAN}[暂无请求]{Colors.RESET}"
        success_ratio = success / total
        success_width = int(width * success_ratio)
        failure_width = width - success_width
        return f"{Colors.GREEN}{'█' * success_width}{Colors.RED}{'█' * failure_width}{Colors.RESET} {success_ratio:.1%}"

    @staticmethod
    def format_traffic(bytes_count):
        if bytes_count < 1024:
            return f"{bytes_count}B"
        elif bytes_count < 1024 * 1024:
            return f"{bytes_count / 1024:.2f}KB"
        elif bytes_count < 1024 * 1024 * 1024:
            return f"{bytes_count / (1024 * 1024):.2f}MB"
        else:
            return f"{bytes_count / (1024 * 1024 * 1024):.2f}GB"

    @staticmethod
    def divider(char="─", length=60):
        return f"{Colors.CYAN}{char * length}{Colors.RESET}"

# 设置 SOCKS5 代理
def setup_socks5_proxy():
    socks.set_default_proxy(socks.SOCKS5, PROXY_HOST, int(PROXY_PORT), username=PROXY_USER, password=PROXY_PASS)
    socket.socket = socks.socksocket
    print(f"{Colors.YELLOW}🔧 已设置 SOCKS5 代理: {PROXY_USER}@{PROXY_HOST}:{PROXY_PORT}{Colors.RESET}")

# 单次 API 请求函数（只发送，不等待响应）
def send_request(api_key, api_index, question, req_id, active_api_keys):
    global success_count, failure_count, minute_success, minute_failure, total_traffic, minute_traffic
    
    headers = {
        "Authorization": f"Bearer {api_key}",
        "accept": "application/json",
        "Content-Type": "application/json"
    }
    
    data = {
        "messages": [
            {"role": "system", "content": "你是一个有用的助手。"},
            {"role": "user", "content": question}
        ],
        "max_tokens": MAX_TOKENS
    }
    
    session = requests.Session()
    retries = Retry(total=RETRY_COUNT, backoff_factor=BACKOFF_FACTOR, status_forcelist=[500, 502, 503, 504], allowed_methods=["POST"])
    session.mount("https://", HTTPAdapter(max_retries=retries))
    
    beijing_tz = pytz.timezone('Asia/Shanghai')
    timestamp = datetime.now(beijing_tz).strftime("%H:%M:%S")
    try:
        # 发送请求，不等待响应
        response = session.post(URL, headers=headers, json=data, timeout=TIMEOUT, stream=True)
        request_traffic = len(json.dumps(headers)) + len(json.dumps(data))
        
        # 异步处理响应
        def handle_response():
            global success_count, failure_count, minute_success, minute_failure, total_traffic, minute_traffic
            try:
                response.raise_for_status()
                response_text = response.text
                response_traffic = len(str(response.headers)) + len(response_text)
                traffic = request_traffic + response_traffic
                with lock:
                    total_traffic += traffic
                    minute_traffic += traffic
                    success_count += 1
                    minute_success += 1
                print(f"{Colors.PURPLE}[{timestamp}] {Colors.GREEN}✔ 请求-{req_id:04d} | 成功 #{success_count:04d} | 流量: {DisplayUtils.format_traffic(traffic)}{Colors.RESET}")
            except requests.exceptions.RequestException as e:
                with lock:
                    failure_count += 1
                    minute_failure += 1
                error_type = str(e.response.status_code) if hasattr(e.response, 'status_code') else "Timeout"
                print(f"{Colors.PURPLE}[{timestamp}] {Colors.RED}✘ 请求-{req_id:04d} | 失败 #{failure_count:04d} | 错误: {error_type}{Colors.RESET}")
                if hasattr(e.response, 'status_code'):
                    if e.response.status_code == 401:
                        print(f"{Colors.PURPLE}[{timestamp}] {Colors.YELLOW}⚠ API {api_index} | 401认证失败{Colors.RESET}")
                    elif e.response.status_code == 402:
                        print(f"{Colors.PURPLE}[{timestamp}] {Colors.YELLOW}⚠ API {api_index} | 402额度不足{Colors.RESET}")
                        with lock:
                            if api_key in active_api_keys:
                                active_api_keys.remove(api_key)
                    elif e.response.status_code == 404:
                        print(f"{Colors.PURPLE}[{timestamp}] {Colors.YELLOW}⚠ API {api_index} | 404未找到端点{Colors.RESET}")
        
        threading.Thread(target=handle_response, daemon=True).start()
    except requests.exceptions.RequestException as e:
        with lock:
            failure_count += 1
            minute_failure += 1
        error_type = str(e.response.status_code) if hasattr(e, 'response') and hasattr(e.response, 'status_code') else "Timeout"
        print(f"{Colors.PURPLE}[{timestamp}] {Colors.RED}✘ 请求-{req_id:04d} | 失败 #{failure_count:04d} | 错误: {error_type}{Colors.RESET}")
    except Exception as e:
        with lock:
            failure_count += 1
            minute_failure += 1
        error_type = "Unknown"
        print(f"{Colors.PURPLE}[{timestamp}] {Colors.RED}✘ 请求-{req_id:04d} | 失败 #{failure_count:04d} | 错误: {error_type}{Colors.RESET}")

# 滚动并发工作线程（极致发送速度）
def scrolling_worker(active_api_keys):
    while True:
        try:
            api_key, api_index, question, req_id = task_queue.get_nowait()
            send_request(api_key, api_index, question, req_id, active_api_keys)
            task_queue.task_done()
        except queue.Empty:
            time.sleep(0.001)  # 极短休眠，保持高吞吐量
            continue  # 继续循环，不退出

# 主程序：滚动并发
def auto_chat_scrolling():
    global success_count, failure_count, start_time, last_stats_time, minute_success, minute_failure, total_traffic, minute_traffic, request_id
    
    # 设置 SOCKS5 代理
    setup_socks5_proxy()
    
    # 打印启动信息
    print(f"{DisplayUtils.divider()}")
    print(f"{Colors.BLUE}🚀 滚动并发发送系统启动{Colors.RESET}")
    print(f"{Colors.CYAN}📊 配置: {len(QUESTIONS)}问题 | {len(API_KEYS)}API | {THREAD_COUNT}线程{Colors.RESET}")
    print(f"{Colors.YELLOW}📡 端点: {URL}{Colors.RESET}")
    print(f"{DisplayUtils.divider()}")
    
    active_api_keys = API_KEYS.copy()
    
    # 启动工作线程
    threads = []
    for i in range(THREAD_COUNT):
        t = threading.Thread(target=scrolling_worker, args=(active_api_keys,), daemon=True)
        t.start()
        threads.append(t)
    
    # 主线程负责填充任务队列
    while True:
        try:
            current_time = time.time()
            if len(active_api_keys) == 0:
                beijing_tz = pytz.timezone('Asia/Shanghai')
                timestamp = datetime.now(beijing_tz).strftime("%H:%M:%S")
                print(f"{Colors.RED}[{timestamp}] 🚫 所有API不可用，程序退出{Colors.RESET}")
                break
            
            # 快速填充任务队列
            for _ in range(THREAD_COUNT):  # 每次填充等于线程数的任务
                if not task_queue.full():
                    with lock:
                        request_id += 1
                    api_key = random.choice(active_api_keys)
                    api_index = API_KEYS.index(api_key)
                    question = random.choice(QUESTIONS)
                    task_queue.put_nowait((api_key, api_index, question, request_id))
            
            # 统计信息
            elapsed_time = current_time - last_stats_time
            if elapsed_time >= STATS_INTERVAL:
                total_minutes = int((current_time - start_time) // 60) + 1
                beijing_tz = pytz.timezone('Asia/Shanghai')
                timestamp = datetime.now(beijing_tz).strftime("%H:%M:%S")
                print(f"\n{DisplayUtils.divider('═')}")
                print(f"{Colors.BLUE}[{timestamp}] 📈 第{total_minutes}分钟统计{Colors.RESET}")
                print(f"{Colors.CYAN}│ 成功: {Colors.GREEN}{minute_success:04d}{Colors.RESET} | 失败: {Colors.RED}{minute_failure:04d}{Colors.RESET} | 成功率: {DisplayUtils.progress_bar(minute_success, minute_failure)}{Colors.RESET}")
                print(f"{Colors.CYAN}│ 本分钟流量: {Colors.YELLOW}{DisplayUtils.format_traffic(minute_traffic)}{Colors.RESET} | 累计流量: {Colors.YELLOW}{DisplayUtils.format_traffic(total_traffic)}{Colors.RESET}")
                print(f"{Colors.CYAN}│ 总成功: {Colors.GREEN}{success_count:04d}{Colors.RESET} | 总失败: {Colors.RED}{failure_count:04d}{Colors.RESET} | 运行时长: {Colors.YELLOW}{int(current_time - start_time)}秒{Colors.RESET}")
                print(f"{DisplayUtils.divider('═')}\n")
                last_stats_time = current_time
                last_minute_start = current_time
                minute_success = 0
                minute_failure = 0
                minute_traffic = 0
            
            time.sleep(0.001)  # 主线程极短休眠，保持高频填充
            
        except KeyboardInterrupt:
            beijing_tz = pytz.timezone('Asia/Shanghai')
            timestamp = datetime.now(beijing_tz).strftime("%H:%M:%S")
            print(f"\n{DisplayUtils.divider('═')}")
            print(f"{Colors.BLUE}[{timestamp}] 🎬 程序退出{Colors.RESET}")
            print(f"{Colors.CYAN}│ 总成功: {Colors.GREEN}{success_count:04d}{Colors.RESET} | 总失败: {Colors.RED}{failure_count:04d}{Colors.RESET}")
            print(f"{Colors.CYAN}│ 总流量: {Colors.YELLOW}{DisplayUtils.format_traffic(total_traffic)}{Colors.RESET}")
            print(f"{Colors.CYAN}│ 运行时长: {Colors.YELLOW}{int(time.time() - start_time)}秒{Colors.RESET}")
            print(f"{DisplayUtils.divider('═')}")
            break
        except Exception as e:
            beijing_tz = pytz.timezone('Asia/Shanghai')
            timestamp = datetime.now(beijing_tz).strftime("%H:%M:%S")
            print(f"{Colors.RED}[{timestamp}] 🛑 主线程错误: {e}{Colors.RESET}")
            time.sleep(1)  # 出错时稍长休眠，避免无限循环错误

if __name__ == "__main__":
    if not API_KEYS or not QUESTIONS:
        print(f"{Colors.RED}❌ 错误: 请在 API_KEYS 和 QUESTIONS 中填入数据{Colors.RESET}")
    else:
        auto_chat_scrolling()
